import React from 'react';
import './Header.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Link} from 'react-router-dom';

const Header = props =>{
   return (
      <div className="head">
         <div className="container">
            <div className="row">
               <div className="col-xl">
                  <img id="logo" src={require("../images/logo.png")}/>
                  <h1 id="title"> INFORM </h1>
               </div>
               <div className="col-">
                        <Link to="/aboutus"> 
                           <button type="button" class="btn btn-outline-light"> About Us </button>
                        </Link>
                        <Link to="/article"> 
                           <button type="button" class="btn btn-outline-light"> Stories </button>
                        </Link>
                        <Link to="/addstory"> 
                           <button type="button" class="btn btn-dark"> Add Story </button>
                        </Link>
               </div>
            </div>
         </div>
      </div>
   );
}

export default Header;
